import React, { Component } from 'react';
import firebase from "../../firebase";
import history from '../../history';

class Quiz extends Component {
    state = { 
        score: 0
     }

    userID = this.props.location.state.userID

    onSubmit = () => {
        let elem = document.getElementsByClassName("question-list")
        let checkedBoxes = elem.querySelectorAll('input[name=chkBox]:checked');
        console.log(checkedBoxes.length)

    }

    render() { 
        return (
            <div className="question-list">
                <h1>User ID: {this.userID}</h1>
                <form onSubmit={this.onSubmit}>
                    <div className="form-check">
                        <input type="checkbox" name="chkBox" className="form-check-input" id="q1"></input>
                        <label className="form-check-label" for="q1">Question 1:</label>
                    </div>

                    <div className="form-check">
                        <input type="checkbox" name="chkBox" className="form-check-input" id="q2"></input>
                        <label className="form-check-label" for="q2">Question 2:</label>
                    </div>

                    <div className="form-check">
                        <input type="checkbox" name="chkBox" className="form-check-input" id="q3"></input>
                        <label className="form-check-label" for="q2">Question 3:</label>
                    </div>

                    <div className="form-check">
                        <input type="checkbox" name="chkBox" className="form-check-input" id="q4"></input>
                        <label className="form-check-label" for="q2">Question 4:</label>
                    </div>

                    <div className="form-check">
                        <input type="checkbox" name="chkBox" className="form-check-input" id="q5"></input>
                        <label className="form-check-label" for="q2">Question 5:</label>
                    </div>

                    <button type="submit" className="btn btn-primary">Take the Quiz!</button>

                </form>
            </div>

        );
    }
}

export default Quiz;
